import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart
    // Using a locator that finds the product card by its title and then the "Add to Cart" button within it.
    const productCardLocator = page.locator('div.product-card', { hasText: 'Sony WH-1000XM5' });
    await productCardLocator.getByRole('button', { name: 'Add to Cart' }).click();

    // Wait for the notification to confirm the action
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // 3. Locate the specific cart item and get its initial quantity
    const cartItemLocator = page.locator('.cart-item', { hasText: 'Sony WH-1000XM5' });
    const initialQuantity = await cartItemLocator.locator('span.quantity').textContent();

    // 4. Click the increase quantity button (+)
    // The second button with class 'quantity-btn' is the '+' button
    await cartItemLocator.locator('button.quantity-btn').nth(1).click();

    // Wait for the quantity to update. We can assert the text content changes.
    await page.waitForFunction(
      (selector) => document.querySelector(selector).textContent.trim() === '2',
      ".cart-item:has-text('Sony WH-1000XM5') span.quantity",
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // 5. Extract the new quantity to verify
    const newQuantity = await cartItemLocator.locator('span.quantity').textContent();

    const extractedData = {
      productTitle: 'Sony WH-1000XM5 Wireless Noise Canceling Headphones',
      initialQuantity: parseInt(initialQuantity, 10),
      newQuantity: parseInt(newQuantity, 10)
    };

    if (extractedData.newQuantity !== extractedData.initialQuantity + 1) {
      throw new Error('Quantity did not update correctly.');
    }

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
